import OfficialListModal1 from "./modules/OfficialListModal1";
import { JeecgListMixin } from "@/mixins/JeecgListMixin";
export default {
  name: "OfficialList",
  mixins: [JeecgListMixin],
  components: {
    OfficialListModal1
  },
  data() {
    return {
      description: "官方赠送列表",
      type: "ambassadorList1",
      columns: [
         {
          title: "赠送账号类型",
          align: "center",
          dataIndex: "role",
            customRender: function(text) {
            if (text == "1") {
              return "VIP";
            } else if (text == "2") {
              return "创客达人";
            } else if (text == "3") {
              return "大使服务商";
            }
          }
        },
           
        {
          title: "被赠送人昵称",
          align: "center",
          dataIndex: "nickName"
        },
        {
          title: "被赠送人手机号",
          align: "center",
          dataIndex: "phone"
        },
        {
          title: "被赠送人v云号",
          align: "center",
          dataIndex: "code",
        },
        {
          title: "赠送人昵称",
          align: "center",
          dataIndex: "inviteNickName"
        },
        {
          title: "赠送人手机号",
          align: "center",
          dataIndex: "invitePhone"
        },
        {
          title: "赠送人账号",
          align: "center",
          dataIndex: "inviteCode"
        }
      ],
      url: {
        list: "/system/appuserinfo/giving-relation-list"
      }
    };
  }
};
